// src/pages/Blog.jsx
import React from "react";

const Blog = () => {
  // Sample blog post data
  const blogPosts = [
    {
      id: 1,
      title: "Introduction to React Hooks",
      content:
        "React Hooks provide a more concise and readable way to work with state and side effects in React functional components.",
    },
    {
      id: 2,
      title: "Getting Started with Tailwind CSS",
      content:
        "Tailwind CSS is a utility-first CSS framework that helps you quickly build custom designs without having to leave your HTML.",
    },
    // Add more blog posts as needed
  ];

  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-4">Latest Blog Posts</h1>
      {blogPosts.map((post) => (
        <div key={post.id} className="mb-8">
          <h2 className="text-2xl font-bold mb-2">{post.title}</h2>
          <p>{post.content}</p>
        </div>
      ))}
    </div>
  );
};

export default Blog;
